import { Outlet } from 'react-router-dom';

export default function Layout() {
  return (
    <div style={{ padding: '20px' }}>
      <nav style={{ marginBottom: '20px' }}>
        <a href="/" style={{ marginRight: '10px' }}>Home</a>
        <a href="/test">Test Route</a>
      </nav>
      <Outlet />
    </div>
  );
}
